import React, { Component } from 'react'

import cover from '../cover.jpg'
import YoutubeFooter from '../Components/YoutubeFooter';
import Footer from '../Components/Footer';



export default class Home extends Component {

    render() {
        return (
            <div style = {{}}>
                <img style = {{width: '100%', verticalAlign: 'middle'}} src = {cover} alt="cover photo"/>



                <div style = {{position: 'relative', top: -270}}>
                    {/* <h5 style = {{color: 'white'}}>Featured Track</h5> */}
                    <div style = {{height: 94, position: 'relative', top: 187}}>
                    </div>
                    <div style = {{height: 94, backgroundColor: 'purple', position: 'relative', top: 187}}>
                    </div>
                    <img style = {{position: 'relative', width: 250, verticalAlign: 'middle'}} src = {'https://img.youtube.com/vi/7Auf9rBvNbY/0.jpg'} alt="cover photo"/>
                    <div style = {{height: '700px', backgroundColor: '#2e2e2e'}}>
                    </div>
                </div>


                <YoutubeFooter 
                    title = "Goodbye" 
                    author = "Post Malone"
                    url = "https://www.youtube.com/watch?v=ba7mB8oueCY"/>
                <Footer/>
            </div>
          );
    }
}
